(1, 'demo_mode', '0'),
(2, 'help', '<p>Precisa de ajuda?</p>\r\n\r\n<p>Estamos aqui para oferecer o melhor suporte. Entre em contato e vamos responder o mais r&aacute;pido poss&iacute;vel.</p>\r\n'),
(3, 'page_privacy', '<p>Pol&iacute;tica de Privacidade<br />\r\nN&oacute;s estamos preocupados com a forma como suas informa&ccedil;&otilde;es s&atilde;o usadas e compartilhadas, agradecemos sua confian&ccedil;a de que cuidaremos delas com aten&ccedil;&atilde;o e sensatez. O presente documento demonstra como tratamos suas informa&ccedil;&otilde;es pessoais obtidas em web sites, servi&ccedil;os, lojas, aplicativos e parceiros.</p>\r\n\r\n<p>A Vamo coleta e processa grandes volumes de dados, atuando na prote&ccedil;&atilde;o e privacidade destes. Ao utilizar os Servi&ccedil;os da Vamo, de seus parceiros ou ao fazer neg&oacute;cio com um lojista que utiliza os Servi&ccedil;os da Vamo, voc&ecirc; concorda com os termos desta Pol&iacute;tica de privacidade e, quando aplic&aacute;vel, com os Termos de servi&ccedil;o da Vamo.</p>\r\n\r\n<p><strong>Controladores de informa&ccedil;&otilde;es pessoais</strong></p>\r\n\r\n<p>A Vamo s&atilde;o as controladoras dos dados pessoais coletados e tratados pelos sistemas automatizados ou fornecidos pelos pr&oacute;prios usu&aacute;rios.</p>\r\n\r\n<p>Coletamos suas informa&ccedil;&otilde;es para prestar os servi&ccedil;os necess&aacute;rios ao neg&oacute;cio e continuamente melhorar nossos produtos e servi&ccedil;os.</p>\r\n\r\n<p><strong>Esses s&atilde;o os tipos de informa&ccedil;&otilde;es pessoais que coletamos:</strong></p>\r\n\r\n<p>Informa&ccedil;&otilde;es que voc&ecirc; nos fornece: Recebemos e armazenamos as informa&ccedil;&otilde;es que voc&ecirc; nos fornece nos sistemas de cadastro e navega&ccedil;&atilde;o em nossos portais. Voc&ecirc; pode optar por n&atilde;o fornecer certas informa&ccedil;&otilde;es, mas, neste caso, pode n&atilde;o conseguir se beneficiar de muitos de nossos Servi&ccedil;os da Vamo.</p>\r\n\r\n<p>Informa&ccedil;&otilde;es autom&aacute;ticas: Coletamos e armazenamos automaticamente alguns tipos de informa&ccedil;&otilde;es sobre a sua navega&ccedil;&atilde;o, tornando a mais objetiva e adequada, incluindo sua intera&ccedil;&atilde;o com o conte&uacute;do e os servi&ccedil;os disponibilizados pelos Servi&ccedil;os da Vamo. Assim como muitos web sites, usamos cookies e outros identificadores &uacute;nicos e coletamos certos tipos de informa&ccedil;&otilde;es quando o seu navegador ou dispositivo acessa os Servi&ccedil;os da Vamo ou parceiros e outros conte&uacute;dos fornecidos outros web sites, parceiros da Vamo.</p>\r\n\r\n<p>Informa&ccedil;&otilde;es de outras fontes: Poderemos receber informa&ccedil;&otilde;es sobre voc&ecirc; de outras fontes, tais como informa&ccedil;&otilde;es atualizadas de entrega e informa&ccedil;&otilde;es de endere&ccedil;o das nossas transportadoras, as quais usamos para corrigir nossos registros e entregar sua pr&oacute;xima entrega de forma mais f&aacute;cil. Ainda, recebemos informa&ccedil;&otilde;es do hub de fornecedores da Vamo para agilizar a entrega de seus produtos e servi&ccedil;os. Tamb&eacute;m coletamos dados sobre como e quando voc&ecirc; acessa a sua conta e a plataforma da Vamo, inclusive informa&ccedil;&otilde;es sobre o dispositivo e o navegador que voc&ecirc; utiliza, sua conex&atilde;o de rede, endere&ccedil;o IP.</p>\r\n\r\n<p>Tamb&eacute;m utilizaremos seus dados pessoais em outros casos, desde que voc&ecirc; nos conceda permiss&atilde;o expressa.</p>\r\n\r\n<p><strong>Dados de fornecedores</strong></p>\r\n\r\n<p>Ao utilizar os Servi&ccedil;os da Vamo, nossos parceiros concordam em agir com o consentimento de seus clientes para a utiliza&ccedil;&atilde;o dos dados pessoais deles pela Vamo.</p>\r\n\r\n<p>Al&eacute;m disso, caso haja a coleta de dados sens&iacute;veis e protegidos, como: dados de hist&oacute;rico m&eacute;dico ou de sa&uacute;de, racial, opini&atilde;o pol&iacute;tica, religiosas, sindical ou orienta&ccedil;&atilde;o sexual, deve ser obtido o consentimento expresso de seus clientes para a utiliza&ccedil;&atilde;o destes dados pessoais.</p>\r\n\r\n<p><strong>Dados de parceiros</strong></p>\r\n\r\n<p>Parceiros s&atilde;o empresas que concordaram com os termos da Vamo e que nos enviam dados de seus clientes para processamento de pedidos, entrega de produtos e fornecimento dos Servi&ccedil;os da Vamo.</p>\r\n\r\n<p>S&atilde;o coletados seu nome; nome da empresa; identificadores de redes sociais; n&uacute;mero(s) de telefone; endere&ccedil;o; dados da compra; e-mail.</p>\r\n\r\n<p>Tamb&eacute;m coletamos dados de sua conta quando acessa a plataforma da Vamo, inclusive informa&ccedil;&otilde;es sobre o dispositivo e o navegador que voc&ecirc; utiliza, sua conex&atilde;o de rede, endere&ccedil;o IP e informa&ccedil;&otilde;es sobre como voc&ecirc; navega.</p>\r\n\r\n<p>Estes dados s&atilde;o utilizados para lhe conceder acesso aos nossos Servi&ccedil;os e aprimor&aacute;-los.</p>\r\n\r\n<p>Tamb&eacute;m utilizaremos seus dados pessoais em outros casos, desde que voc&ecirc; nos conceda permiss&atilde;o expressa.</p>\r\n\r\n<p><strong>Do tratamento dos dados</strong></p>\r\n\r\n<p>Tratamos suas informa&ccedil;&otilde;es pessoais para atender, prestar, desenvolver e melhorar os produtos e servi&ccedil;os que oferecemos a nossos clientes. Essas finalidades incluem:</p>\r\n\r\n<p>Compra e entrega de produtos e servi&ccedil;os. Usamos suas informa&ccedil;&otilde;es pessoais para receber e organizar pedidos, entregar produtos e servi&ccedil;os, confirmar pagamentos e nos comunicar com voc&ecirc; sobre pedidos, produtos, servi&ccedil;os e ofertas promocionais.</p>\r\n\r\n<p>Fornecimento, corre&ccedil;&atilde;o e melhoria de Servi&ccedil;os da Vamo. Usamos suas informa&ccedil;&otilde;es pessoais para oferecer funcionalidades, analisar desempenhos, corrigir erros e melhorar a usabilidade e a efetividade dos Servi&ccedil;os da Vamo.</p>\r\n\r\n<p>Em alguns casos, coletamos e usamos suas informa&ccedil;&otilde;es pessoais para cumprir determina&ccedil;&otilde;es legais. Por exemplo, coletamos de vendedores informa&ccedil;&otilde;es sobre o local do estabelecimento e as informa&ccedil;&otilde;es para verifica&ccedil;&atilde;o de identidade e outros fins.</p>\r\n\r\n<p>Usamos suas informa&ccedil;&otilde;es pessoais para nos comunicarmos com voc&ecirc; com rela&ccedil;&atilde;o aos Servi&ccedil;os da Vamo por v&aacute;rios canais: telefone, e-mail, chat etc.</p>\r\n\r\n<p>N&oacute;s n&atilde;o usamos informa&ccedil;&otilde;es que identificam voc&ecirc; diretamente para mostrar an&uacute;ncios baseados em interesse.</p>\r\n\r\n<p>Tratamos informa&ccedil;&otilde;es pessoais para impedir e detectar fraude e abuso a fim de proteger a seguran&ccedil;a dos clientes, terceiros e parceiros.</p>\r\n\r\n<p>Podemos pedir o seu consentimento para tratar suas informa&ccedil;&otilde;es pessoais para uma finalidade espec&iacute;fica. Quando voc&ecirc; concorda com o tratamento de suas informa&ccedil;&otilde;es pessoais para uma finalidade espec&iacute;fica, voc&ecirc; pode revogar o seu consentimento a qualquer momento e n&oacute;s pararemos de tratar seus dados para essa finalidade espec&iacute;fica.</p>\r\n\r\n<p><strong>Dados de Crian&ccedil;as n&atilde;o ser&atilde;o coletadas</strong></p>\r\n\r\n<p>Caso voc&ecirc; seja menor de 18 anos, voc&ecirc; s&oacute; poder&aacute; utilizar nossos servi&ccedil;os em caso expresso de consentimento de seus pais ou respons&aacute;veis legais. De outra forma, n&atilde;o ser&atilde;o coletados dados de menores de 18 anos.</p>\r\n\r\n<p><strong>Quando e por que compartilhamos esses dados com terceiros?</strong></p>\r\n\r\n<p>A Vamo trabalha com v&aacute;rios parceiros e prestadores de servi&ccedil;os, onde, em alguns casos, ser&aacute; necess&aacute;rio compartilhar dados pessoais com eles, que tamb&eacute;m est&atilde;o sujeitas a este Termo de Privacidade e seguem pr&aacute;ticas t&atilde;o protetivas quanto as descritas neste Termo.</p>\r\n\r\n<p>Os dados pessoais tamb&eacute;m podem ser compartilhados com a empresa que adquirir nosso neg&oacute;cio por meio de incorpora&ccedil;&atilde;o, aquisi&ccedil;&atilde;o fal&ecirc;ncia, dissolu&ccedil;&atilde;o, reorganiza&ccedil;&atilde;o ou outra ocasi&atilde;o que ser&aacute; comunicada com anteced&ecirc;ncia.</p>\r\n\r\n<p>A Vamo sempre solicitar&aacute; o seu consentimento antes de compartilhar seus dados pessoais com terceiros para finalidades espec&iacute;ficas. Sendo, a Vamo, respons&aacute;vel por toda transfer&ecirc;ncia subsequente de dados pessoais para terceiros, de acordo com o A Lei Geral de Prote&ccedil;&atilde;o de Dados Pessoais e o Regulamento Europeu de Prote&ccedil;&atilde;o de Dados Pessoais (GDPR).</p>\r\n\r\n<p>N&oacute;s n&atilde;o compartilhamos, divulgamos, vendemos, alugamos ou de outra forma fornecemos informa&ccedil;&otilde;es pessoais a empresas n&atilde;o atuantes da Plataforma da Vamo.</p>\r\n\r\n<p><strong>Dados de cookies e de navega&ccedil;&atilde;o</strong></p>\r\n\r\n<p>Um cookie &eacute; um arquivo de dados que pode conter um identificador &uacute;nico. Os cookies s&atilde;o enviados por um site para o seu navegador e armazenados em seu dispositivo. N&oacute;s atribu&iacute;mos um cookie diferente para cada dispositivo que acessa nosso site. Utilizamos cookies para reconhecer o seu dispositivo e oferecer uma experi&ecirc;ncia personalizada em nossos sites ou Servi&ccedil;os, podendo ser utilizado como parte de nossos Servi&ccedil;os ou de parceiros.</p>\r\n\r\n<p><strong>Meios que coletamos de dados</strong></p>\r\n\r\n<p>Quando voc&ecirc; procura ou compra de produtos ou servi&ccedil;os em nossas lojas ou de parceiros utilizadores de nossa plataforma; adiciona ou remove um item do seu carrinho; faz um pedido ou usa Servi&ccedil;os da Vamo; visualiza ou usa conte&uacute;do em um dispositivo ou atrav&eacute;s de um servi&ccedil;o ou aplicativo, fornece informa&ccedil;&otilde;es em sua conta de usu&aacute;rio; conversa ou interage de outra forma com o nosso servi&ccedil;o; fornece permiss&otilde;es de acesso a dados ou interage com um servi&ccedil;o da Vamo; oferece produtos ou servi&ccedil;os na Plataforma Vamo; comunica-se conosco por telefone, e-mail ou de outro modo; em pedido de suporte ou formul&aacute;rio de nossos servi&ccedil;os; cria e avalia nossos servi&ccedil;os ou de nossos parceiros; gerencia ou cria alerta de Disponibilidade de Produto com os nossos parceiros.</p>\r\n\r\n<p>Deste modo, podemos coletar os seguintes dados: seu nome; endere&ccedil;o; n&uacute;mero de telefone; informa&ccedil;&otilde;es de pagamento; sua idade; suas informa&ccedil;&otilde;es de localiza&ccedil;&atilde;o; seu endere&ccedil;o de IP; endere&ccedil;os e n&uacute;meros de telefone de pessoas listados em seus Endere&ccedil;os; endere&ccedil;os de e-mail de outras pessoas; conte&uacute;do de avalia&ccedil;&otilde;es e e-mails enviados a n&oacute;s; descri&ccedil;&atilde;o pessoal e foto em Seu perfil; informa&ccedil;&otilde;es e documentos sobre identidade e idoneidade; informa&ccedil;&otilde;es societ&aacute;rias e financeiras.</p>\r\n\r\n<p><strong>Voc&ecirc; possui acesso aos seus dados</strong></p>\r\n\r\n<p>Voc&ecirc; pode acessar suas informa&ccedil;&otilde;es, incluindo seu nome, endere&ccedil;o, informa&ccedil;&otilde;es do perfil, configura&ccedil;&otilde;es no web site que realizou seu cadastro. Podendo entrar em contato com os nossos canais para obter melhores informa&ccedil;&otilde;es sobre seus dados.</p>\r\n\r\n<p><strong>Pol&iacute;tica de privacidade atualizada na data 15/03/2021</strong></p>\r\n'),
(4, 'terms', '<h3><strong><strong>Termos e condi&ccedil;&otilde;es gerais de uso</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Estes Termos e condi&ccedil;&otilde;es gerais aplicam-se ao uso dos servi&ccedil;os oferecidos pelo 51 Vam-Bora Transportes ME, situada na Rua Jo&atilde;o Pedro Pedrossian, n &ordm; 2829 - Jardim Aeroporto- CEP 79570-000, Aparecida do Taboado -MS , doravante nominada&nbsp;51 Vam-Bora, por meio do site&nbsp;51vambora.com</p>\r\n\r\n<p>Qualquer pessoa, doravante nominada Usu&aacute;rio, que pretenda utilizar os servi&ccedil;os da 51 Vam-Bora&nbsp;dever&aacute; aceitar os Termos e condi&ccedil;&otilde;es gerais e todas as demais pol&iacute;ticas e princ&iacute;pios que o regem.</p>\r\n\r\n<p>A aceita&ccedil;&atilde;o destes Termos e condi&ccedil;&otilde;es gerais &eacute; absolutamente indispens&aacute;vel &agrave; utiliza&ccedil;&atilde;o do Site e servi&ccedil;os prestados pela 51 Vam-Bora.</p>\r\n\r\n<p>O Usu&aacute;rio dever&aacute; ler, certificar-se de haver entendido e aceitar todas as condi&ccedil;&otilde;es estabelecidas nos Termos e condi&ccedil;&otilde;es gerais e nas Pol&iacute;ticas de privacidade, assim como nos demais documentos a eles incorporados por refer&ecirc;ncia, antes de seu cadastro como Usu&aacute;rio da 51 Vam-Bora.</p>\r\n\r\n<p>Em caso de d&uacute;vidas, entre em contato conosco no Fale Conosco.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>01 - Objeto</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Os servi&ccedil;os objeto dos presentes Termos e condi&ccedil;&otilde;es gerais consistem em (i) ofertar e hospedar espa&ccedil;os nos Sites para que os Usu&aacute;rios anunciem &agrave; venda seus pr&oacute;prios produtos e/ou servi&ccedil;os e viabilizar o contato direto entre Usu&aacute;rios vendedores e Usu&aacute;rios interessados em adquirir os produtos e servi&ccedil;os anunciados, por meio da divulga&ccedil;&atilde;o dos dados de contato de uma parte &agrave; outra. a 51 Vam-Bora, portanto, possibilita aos Usu&aacute;rios se contatarem e negociarem entre si diretamente, sem qualquer interven&ccedil;&atilde;o da 51 Vam-Bora, na negocia&ccedil;&atilde;o ou na concretiza&ccedil;&atilde;o dos neg&oacute;cios. Desta forma, ressalta-se que a 51 Vam-Bora&nbsp;n&atilde;o fornece quaisquer produtos ou servi&ccedil;os anunciados pelos Usu&aacute;rios nos Sites.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>02 - Capacidade para cadastrar-se</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Os servi&ccedil;os da 51 Vam-Bora&nbsp;est&atilde;o dispon&iacute;veis apenas para as pessoas f&iacute;sicas ou jur&iacute;dicas que tenham capacidade legal para contrat&aacute;-los.</p>\r\n\r\n<p>&Eacute; proibido o cadastro de Usu&aacute;rios que n&atilde;o tenham capacidade civil (com rela&ccedil;&atilde;o a pessoas f&iacute;sicas) ou n&atilde;o sejam representantes legais (com rela&ccedil;&atilde;o a pessoas jur&iacute;dicas), bem como de Usu&aacute;rios que tenham sido suspensos da 51 Vam-Bora, tempor&aacute;ria ou definitivamente, sem preju&iacute;zo da aplica&ccedil;&atilde;o das san&ccedil;&otilde;es legais previstas no C&oacute;digo Civil Brasileiro, notadamente, art. 166, I; 171, I e 180.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>03 - Cadastro</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apenas ser&aacute; confirmado o cadastramento do Usu&aacute;rio que preencher todos os campos obrigat&oacute;rios do cadastro, com informa&ccedil;&otilde;es exatas, precisas e verdadeiras. O Usu&aacute;rio declara e assume o compromisso de atualizar os dados inseridos em seu cadastro (&ldquo;Dados Pessoais&rdquo;) sempre que for necess&aacute;rio.</p>\r\n\r\n<p>Ao se cadastrar na 51 Vam-Bora, o Usu&aacute;rio poder&aacute; utilizar todos os servi&ccedil;os disponibilizados pela empresa do grupo, declarando, para tanto, ter lido, compreendido e aceitado os respectivos Termos e Condi&ccedil;&otilde;es de uso de cada um destes servi&ccedil;os que passam a fazer parte integrante destes Termos e condi&ccedil;&otilde;es gerais quando conclu&iacute;do o cadastro.</p>\r\n\r\n<p>O Usu&aacute;rio acessar&aacute; sua conta atrav&eacute;s de e-mail (login) e senha e compromete-se a n&atilde;o informar a terceiros esses dados, responsabilizando-se integralmente pelo uso que deles seja feito.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o se responsabiliza pela corre&ccedil;&atilde;o dos Dados Pessoais inseridos por seus Usu&aacute;rios. Os Usu&aacute;rios garantem e respondem, em qualquer caso, civil e criminalmente pela veracidade, exatid&atilde;o e autenticidade, dos Dados Pessoais cadastrados.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;se reserva o direito de recusar qualquer solicita&ccedil;&atilde;o de cadastro e de suspender um cadastro previamente aceito, que esteja em desacordo com as pol&iacute;ticas e regras dos presentes Termos e condi&ccedil;&otilde;es gerais.</p>\r\n\r\n<p>O anunciante reconhece que &eacute; o &uacute;nico respons&aacute;vel pela veracidade e pelo conte&uacute;do disponibilizado no seu an&uacute;ncio, isentando a 51 Vam-Bora&nbsp;de qualquer responsabilidade nesse sentido, bem como declara, nos termos da lei, estarem quaisquer im&oacute;veis anunciados em plena regularidade.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;poder&aacute;, a seu exclusivo crit&eacute;rio, realizar as buscas que julgar necess&aacute;rias para apurar dados incorretos ou inver&iacute;dicos, solicitar dados adicionais e documentos que estime serem pertinentes a fim de conferir os Dados Pessoais informados e, ainda, recorrer a base de dados p&uacute;blicas ou privadas, podendo o usu&aacute;rio edit&aacute;-las caso entenda que tais dados n&atilde;o estejam atualizados.</p>\r\n\r\n<p>Caso a 51 Vam-Bora&nbsp;decida checar a veracidade dos dados cadastrais de um Usu&aacute;rio e se constate haver entre eles dados incorretos ou inver&iacute;dicos, poder&aacute; recorrer a dados publicamente dispon&iacute;veis ou a bases de dados comerciais para alterar ou enriquecer os Dados Pessoais, ou, ainda caso o Usu&aacute;rios se furte ou se negue a enviar os documentos requeridos, a 51 Vam-Bora&nbsp;poder&aacute; suspender temporariamente ou definitivamente a conta, sem preju&iacute;zo de outras medidas que entender necess&aacute;rias e oportunas.</p>\r\n\r\n<p>Havendo a aplica&ccedil;&atilde;o de quaisquer das san&ccedil;&otilde;es acima referidas, automaticamente ser&atilde;o cancelados os an&uacute;ncios do respectivo Usu&aacute;rio, n&atilde;o lhe assistindo, por essa raz&atilde;o, qualquer indeniza&ccedil;&atilde;o ou ressarcimento.</p>\r\n\r\n<p>O Usu&aacute;rio compromete-se a notificar a 51 Vam-Bora&nbsp;imediatamente, e por meio seguro, a respeito de qualquer uso n&atilde;o autorizado de sua conta, bem como seu acesso n&atilde;o autorizado por terceiros. O Usu&aacute;rio ser&aacute; o &uacute;nico respons&aacute;vel pelas opera&ccedil;&otilde;es efetuadas em sua conta, uma vez que o acesso s&oacute; ser&aacute; poss&iacute;vel mediante a inclus&atilde;o da senha, que dever&aacute; ser de conhecimento e propriedade exclusiva do Usu&aacute;rio.</p>\r\n\r\n<p>Em nenhuma hip&oacute;tese ser&aacute; permitida a cess&atilde;o, venda, aluguel ou outra forma de transfer&ecirc;ncia da conta (incluindo-se opini&otilde;es e coment&aacute;rios). Tamb&eacute;m n&atilde;o se permitir&aacute; a manuten&ccedil;&atilde;o de mais de um cadastro por uma mesma pessoa, ou ainda a cria&ccedil;&atilde;o de novos cadastros por pessoas cujos cadastros originais tenham sido suspensos tempor&aacute;ria ou definitivamente por infra&ccedil;&otilde;es &agrave;s pol&iacute;ticas da 51 Vam-Bora.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>04 - Modifica&ccedil;&otilde;es dos Termos e condi&ccedil;&otilde;es gerais</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;poder&aacute; alterar, a qualquer tempo, estes Termos e condi&ccedil;&otilde;es gerais, visando seu aprimoramento e melhoria dos servi&ccedil;os prestados. Os novos Termos e condi&ccedil;&otilde;es gerais entrar&atilde;o em vigor 10 (dez) dias ap&oacute;s sua publica&ccedil;&atilde;o nos Site. No prazo de 5 (cinco) dias contados a partir da publica&ccedil;&atilde;o da nova vers&atilde;o, o Usu&aacute;rio dever&aacute; comunicar-se por e-mail caso n&atilde;o concorde com os termos alterados. Nesse caso, o v&iacute;nculo contratual deixar&aacute; de existir, desde que n&atilde;o haja contas ou d&iacute;vidas em aberto. N&atilde;o havendo manifesta&ccedil;&atilde;o no prazo estipulado, entender-se-&aacute; que o Usu&aacute;rio aceitou os novos Termos e condi&ccedil;&otilde;es gerais de uso e o contrato continuar&aacute; vinculando as partes.</p>\r\n\r\n<p>As altera&ccedil;&otilde;es n&atilde;o vigorar&atilde;o em rela&ccedil;&atilde;o &agrave;s negocia&ccedil;&otilde;es e an&uacute;ncios j&aacute; iniciados antes de sua publica&ccedil;&atilde;o, permanecendo, nestes casos, vigente a reda&ccedil;&atilde;o anterior.</p>\r\n\r\n<p><br />\r\n05 - Privacidade da Informa&ccedil;&atilde;o</p>\r\n\r\n<p><br />\r\nToda informa&ccedil;&atilde;o ou Dado Pessoal do Usu&aacute;rio &eacute; armazenado em servidores ou meios magn&eacute;ticos de alta seguran&ccedil;a. Salvo com rela&ccedil;&atilde;o &agrave;s informa&ccedil;&otilde;es que s&atilde;o publicadas nos Sites, a 51 Vam-Bora&nbsp;adotar&aacute; todas as medidas poss&iacute;veis para manter a confidencialidade e a seguran&ccedil;a das informa&ccedil;&otilde;es sigilosas, por&eacute;m n&atilde;o se responsabilizar&aacute; por eventuais preju&iacute;zos que sejam decorrentes da divulga&ccedil;&atilde;o de tais informa&ccedil;&otilde;es por parte de terceiros que utilizem as redes p&uacute;blicas ou a internet, subvertendo os sistemas de seguran&ccedil;a para acessar as informa&ccedil;&otilde;es de Usu&aacute;rios.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>06 - Viola&ccedil;&atilde;o no sistema ou da base de dados</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>N&atilde;o &eacute; permitida a utiliza&ccedil;&atilde;o de nenhum dispositivo, software ou outro recurso que venha a interferir nas atividades e opera&ccedil;&otilde;es da 51 Vam-Bora, bem como nos an&uacute;ncios, descri&ccedil;&otilde;es, contas ou seus bancos de dados. Qualquer intromiss&atilde;o, tentativa ou atividade que viole ou contrarie as leis de direito de propriedade intelectual e/ou as proibi&ccedil;&otilde;es estipuladas nestes Termos e condi&ccedil;&otilde;es gerais de uso, tornar&atilde;o o respons&aacute;vel pass&iacute;vel das a&ccedil;&otilde;es legais pertinentes, bem como das san&ccedil;&otilde;es aqui previstas, sendo ainda respons&aacute;vel pelas indeniza&ccedil;&otilde;es por eventuais danos causados.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>07 - San&ccedil;&otilde;es</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sem preju&iacute;zo de outras medidas cab&iacute;veis, a 51 Vam-Bora&nbsp;poder&aacute; advertir, suspender, tempor&aacute;ria ou definitivamente, a conta de um Usu&aacute;rio, cancelar os seus an&uacute;ncios ou aplicar uma san&ccedil;&atilde;o que impacte negativamente em sua reputa&ccedil;&atilde;o, a qualquer tempo, iniciando as a&ccedil;&otilde;es legais cab&iacute;veis e/ou suspendendo a presta&ccedil;&atilde;o de seus servi&ccedil;os se: a) o Usu&aacute;rio n&atilde;o cumprir qualquer dispositivo destes Termos e condi&ccedil;&otilde;es gerais de uso e demais pol&iacute;ticas da 51 Vam-Bora; b) se descumprir com seus deveres de Usu&aacute;rio; c) se praticar atos fraudulentos ou dolosos; d) se n&atilde;o puder ser verificada a identidade do Usu&aacute;rio ou se qualquer informa&ccedil;&atilde;o fornecida por ele estiver incorreta; e)se a 51 Vam-Bora&nbsp;entender que os an&uacute;ncios ou qualquer atitude do Usu&aacute;rio tenham causado algum dano a terceiros ou ao pr&oacute;pria 51 Vam-Bora&nbsp;ou tenham a potencialidade de assim o fazer. Nos casos suspens&atilde;o da conta do usu&aacute;rio, todos os an&uacute;ncios ativos e/ou ofertas realizadas ser&atilde;o automaticamente cancelados e a informa&ccedil;&atilde;o de que Usu&aacute;rio n&atilde;o pertence mais &agrave; comunidade ser&aacute; inclu&iacute;da ao lado do nome de Usu&aacute;rio.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;reserva-se o direito de, a qualquer momento e a seu exclusivo crit&eacute;rio, solicitar o envio de documenta&ccedil;&atilde;o pessoal e/ou exigir que um Usu&aacute;rio torne-se &lsquo;Certificado&rsquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>08 - Responsabilidades</strong></strong></h3>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o se responsabiliza por v&iacute;cios ou defeitos t&eacute;cnicos e/ou operacionais oriundos do sistema do Usu&aacute;rio ou de terceiros.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o &eacute; o propriet&aacute;rio dos produtos ou prestador dos servi&ccedil;os anunciados pelos Usu&aacute;rios nos Sites, n&atilde;o guarda a posse desses itens e n&atilde;o realiza as ofertas de venda, tampouco interv&eacute;m na entrega dos produtos.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o se responsabiliza, por conseguinte, pela exist&ecirc;ncia, quantidade, qualidade, estado, integridade ou legitimidade dos produtos oferecidos, adquiridos ou alienados pelos Usu&aacute;rios, assim como pela capacidade para contratar dos Usu&aacute;rios ou pela veracidade dos dados pessoais por eles inseridos em seus cadastros. a 51 Vam-Bora&nbsp;n&atilde;o outorga garantia por v&iacute;cios ocultos ou aparentes nas negocia&ccedil;&otilde;es entre os Usu&aacute;rios. Cada Usu&aacute;rio conhece e aceita ser o &uacute;nico respons&aacute;vel pelos produtos que anuncia ou pelas ofertas que realiza.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o ser&aacute; respons&aacute;vel pelo efetivo cumprimento das obriga&ccedil;&otilde;es assumidas pelos Usu&aacute;rios. O Usu&aacute;rio reconhece e aceita ao realizar negocia&ccedil;&otilde;es com outros Usu&aacute;rios ou terceiros o faz por sua conta e risco, reconhecendo a 51 Vam-Bora&nbsp;como mero fornecedor de servi&ccedil;os de disponibiliza&ccedil;&atilde;o de espa&ccedil;o virtual para an&uacute;ncios de produtos e servi&ccedil;os ofertados por terceiros. Em nenhum caso a 51 Vam-Bora&nbsp;ser&aacute; respons&aacute;vel pelo lucro cessante ou por qualquer outro dano e/ou preju&iacute;zo que possa sofrer devido &agrave;s negocia&ccedil;&otilde;es realizadas ou n&atilde;o realizadas por meio dos sites decorrentes da conduta de outros usu&aacute;rios.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;recomenda que toda negocia&ccedil;&atilde;o seja realizada com cautela e bom senso. O Usu&aacute;rio dever&aacute; sopesar os riscos da negocia&ccedil;&atilde;o, levando em considera&ccedil;&atilde;o que pode estar, eventualmente, lidando com pessoas valendo-se de identidade falsa.</p>\r\n\r\n<p>Nos casos em que um ou mais Usu&aacute;rios ou algum terceiro inicie qualquer tipo de reclama&ccedil;&atilde;o ou a&ccedil;&atilde;o legal contra outro ou mais Usu&aacute;rios, todos e cada um dos Usu&aacute;rios envolvidos nas reclama&ccedil;&otilde;es ou a&ccedil;&otilde;es eximem de toda responsabilidade a 51 Vam-Bora&nbsp;e os seus diretores, gerentes, empregados, agentes, oper&aacute;rios, representantes e procuradores.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>09 - Alcance dos servi&ccedil;os</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Estes Termos e condi&ccedil;&otilde;es gerais de uso n&atilde;o geram nenhum contrato de sociedade, mandato, franquia ou rela&ccedil;&atilde;o de trabalho entre 51 Vam-Bora&nbsp;e o Usu&aacute;rio. O Usu&aacute;rio manifesta ci&ecirc;ncia de que a 51 Vam-Bora&nbsp;n&atilde;o &eacute; parte de nenhuma negocia&ccedil;&atilde;o realizada entre Usu&aacute;rios, nem possui controle algum sobre a exist&ecirc;ncia, qualidade, seguran&ccedil;a ou legalidade dos produtos ou servi&ccedil;os anunciados pelos Usu&aacute;rios, sobre a veracidade ou exatid&atilde;o dos an&uacute;ncios elaborados pelos usu&aacute;rios e sobre a capacidade dos Usu&aacute;rios para negociar. a 51 Vam-Bora&nbsp;n&atilde;o pode assegurar o &ecirc;xito de qualquer negocia&ccedil;&atilde;o realizada entre Usu&aacute;rios, tampouco verificar a identidade ou dos Dados Pessoais dos usu&aacute;rios.</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o garante a veracidade da publica&ccedil;&atilde;o de terceiros que apare&ccedil;a em seu site e n&atilde;o ser&aacute; respons&aacute;vel pela correspond&ecirc;ncia ou contratos que o Usu&aacute;rio realize com terceiros.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>10 - Falhas no sistema</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>a 51 Vam-Bora&nbsp;n&atilde;o se responsabiliza por qualquer dano, preju&iacute;zo ou perda sofridos pelo Usu&aacute;rio em raz&atilde;o de falhas na internet, no sistema ou no servidor utilizado pelo usu&aacute;rio, decorrentes de condutas de terceiros, caso fortuito ou for&ccedil;a maior. a 51 Vam-Bora&nbsp;tamb&eacute;m n&atilde;o ser&aacute; respons&aacute;vel por qualquer v&iacute;rus que possa atacar o equipamento do usu&aacute;rio em decorr&ecirc;ncia do acesso, utiliza&ccedil;&atilde;o ou navega&ccedil;&atilde;o na internet ou como consequ&ecirc;ncia da transfer&ecirc;ncia de dados, arquivos, imagens, textos, v&iacute;deos ou &aacute;udio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>11 - Propriedade Intelectual e links</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O uso comercial da express&atilde;o &quot;51 Vam-Bora&quot; como marca, nome empresarial ou nome de dom&iacute;nio, bem como os conte&uacute;dos das telas relativas aos servi&ccedil;os da 51 Vam-Bora&nbsp;assim como os programas, look and feel dos Sites, bancos de dados, redes, arquivos que permitem ao Usu&aacute;rio acessar e usar a sua Conta s&atilde;o propriedade da 51 Vam-Bora&nbsp;e est&atilde;o protegidos pelas leis e tratados internacionais de direito autoral, marcas, patentes, modelos e desenhos industriais. O uso indevido e a reprodu&ccedil;&atilde;o total ou parcial dos referidos conte&uacute;dos s&atilde;o proibidos, salvo a autoriza&ccedil;&atilde;o pr&eacute;via e expressa por escrito da 51 Vam-Bora.</p>\r\n\r\n<p>Os sites podem manter links com outros sites, o que n&atilde;o significa que esses sites sejam de propriedade ou operados pela 51 Vam-Bora. N&atilde;o possuindo controle sobre esses sites de terceiros, raz&atilde;o pela qual a 51 Vam-Bora&nbsp;n&atilde;o ser&aacute; respons&aacute;vel pelos seus conte&uacute;dos, pr&aacute;ticas e servi&ccedil;os ofertados. A presen&ccedil;a de links para outros sites n&atilde;o implica rela&ccedil;&atilde;o de sociedade, de supervis&atilde;o, de cumplicidade ou solidariedade da 51 Vam-Bora&nbsp;para com esses sites e seus conte&uacute;dos.</p>\r\n\r\n<p>O Usu&aacute;rio declara e garante que &eacute; titular, possui a devida autoriza&ccedil;&atilde;o do(s) titular(es) de direito(s) de propriedade intelectual ou que, de outra forma, pode anunciar na 51 Vam-Bora, oferecer produtos e/ou servi&ccedil;os anunciados ou declarar-se loja oficial de determinada marca, sendo o &uacute;nico respons&aacute;vel pelo conte&uacute;do das suas publica&ccedil;&otilde;es.</p>\r\n\r\n<p>O Usu&aacute;rio assume total responsabilidade por todos os preju&iacute;zos, diretos e indiretos, inclusive indeniza&ccedil;&otilde;es, lucros cessantes, honor&aacute;rios advocat&iacute;cios e demais encargos judiciais e extrajudiciais que a 51 Vam-Bora&nbsp;seja obrigado a incorrer em virtude de ato ou omiss&atilde;o do Usu&aacute;rio.</p>\r\n\r\n<p>Se a 51 Vam-Bora&nbsp;receber alguma reclama&ccedil;&atilde;o ou questionamento de terceiros (por exemplo, dos titulares de marca), a 51 Vam-Bora&nbsp;poder&aacute; remover o seu an&uacute;ncio e aplicar as san&ccedil;&otilde;es cab&iacute;veis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong>12 - Indeniza&ccedil;&atilde;o</strong></strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O usu&aacute;rio indenizar&aacute; a 51 Vam-Bora, suas filiais, empresas controladas ou controladoras, diretores, administradores, colaboradores, representantes e empregados por qualquer demanda promovida por outros Usu&aacute;rios ou terceiros decorrentes de suas atividades no Site ou por seu descumprimento dos Termos e condi&ccedil;&otilde;es gerais de uso e demais pol&iacute;ticas da 51 Vam-Bora, ou pela viola&ccedil;&atilde;o de qualquer lei ou direitos de terceiros, incluindo honor&aacute;rios de advogados.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
